useEffect(() => {
  const show = document.getElementByid("1");
  show.classList.remove("transform");
}, []);
export default function Contact() {
  return (
    <div className="ContainerSection tranform" id="1">
      <div className="AboutMeGridContainer">
        <div className="AboutMe-Photo"></div>
        <div className="AboutMe-Text"></div>
      </div>
    </div>
  );
}
